#####################################
# Some variables:
SET s 1
SET f 50
SET u 200000
SET d /Users/amlalejini/DataPlayground/plast_as_building_block/iter_3/exp_data
#####################################

#################
# BATCH GUIDE
# 0: Seed genotype
# 1: Final dominant genotype
# 2: Final dominant lineage
#################

# For each treatment:
FOREACH t Q4T1
  FORRANGE i $s $f
    # For each trial/replicate:
    # Cleaning:
    PURGE_BATCH 0
    PURGE_BATCH 1
    PURGE_BATCH 2

    # Load seed population into batch 0
    SET_BATCH 0
    LOAD $d/$t__rep_$i/data/detail-0.spop
    # Filter batch down to single org (this is not actually necessary)
    FIND_GENOTYPE num_cpus

    # Load final population into batch 1
    SET_BATCH 1
    LOAD $d/$t__rep_$i/data/detail-$u.spop
    DUPLICATE 1 2 # Copy final population over to batch 2
    # Filter batch 1 down to final dominant genotype
    FIND_GENOTYPE num_cpus

    # Filter batch 2 down to lineage of final dominant.
    SET_BATCH 2
    FIND_LINEAGE num_cpus

    # For each seed environment:
    #   * set that environment
    #   * test seed genotype in environment
    #   * print, trace, detail
    ECHO "BEGIN: SEED TESTS"
###################
# SEED ENV TESTS 
###################
SET_BATCH 0

# ENV: {'NOT': 1, 'NAND': 1}
SetReactionValue NOT 1
SetReactionValue NAND 1
SetReactionValue NOT2 0
SetReactionValue NAND2 0
SetReactionValue NOT3 0
SetReactionValue NAND3 0
RECALC 
DETAIL analysis/$t__rep_$i/seed/ENV___NOT_1__NAND_1/seed_details.dat id ancestor_dist parent_dist fitness_ratio comp_merit_ratio parent_muts num_cpus fitness update_born depth viable length copy_length exe_length gest_time sequence task.0 task.1 task.2 task.3 task.4 task.5 task.6 task.7
